import React from 'react'
import { useSelector } from 'react-redux'
const CartItems = () => {
const items=useSelector(state=>state.itemList)
console.log(items)
return (
    <div>
       <h2>CartItems</h2>
       <ul>
        {items.map((el,id)=>{
            return<li key={el.id}>{el.name} Price:{el.price}Quantity:{el.quantity}Total:{el.totalPrice}
            <button>increment</button><button>decrement</button></li>
        })}
       </ul>
    </div>
  )
}

export default CartItems
